import React from 'react';
import Card from './Card';
import categorias from '../categorias.json';
let array = categorias.categorias;

const CardList = () =>{

    return(
        <>
            <h2>Categorias</h2>
            <Card info={array[1]}/>

        </>
    )
}

export default CardList;
